package com.yaowang.entity;import java.io.Serializable;import java.util.Date;/** * 后台角色  * @author  *  */public class AdminRole implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 角色名	 */	private String name;	/**	 * 状态（0：删除，1：正常，2：停用）	 */	private String state;	/**	 * 是否系统内置（0：否，1：是）	 */	private Boolean isSys;	/**	 * 排序号	 */	private String displayOrder;	/**	 * 创建时间	 */	private Date createTime;	/**	 * 首页地址	 */	private String indexUrl;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置角色名	 */	 public void setName(String name){	 	this.name = name;	 }	 	 /**	  * 获取角色名	  */	 public String getName(){	 	return this.name;	 }	/**	 * 设置状态（0：删除，1：正常，2：停用）	 */	 public void setState(String state){	 	this.state = state;	 }	 	 /**	  * 获取状态（0：删除，1：正常，2：停用）	  */	 public String getState(){	 	return this.state;	 }	/**	 * 设置是否系统内置（0：否，1：是）	 */	 public void setIsSys(Boolean isSys){	 	this.isSys = isSys;	 }	 	 /**	  * 获取是否系统内置（0：否，1：是）	  */	 public Boolean getIsSys(){	 	return this.isSys;	 }	/**	 * 设置排序号	 */	 public void setDisplayOrder(String displayOrder){	 	this.displayOrder = displayOrder;	 }	 	 /**	  * 获取排序号	  */	 public String getDisplayOrder(){	 	return this.displayOrder;	 }	/**	 * 设置创建时间	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取创建时间	  */	 public Date getCreateTime(){	 	return this.createTime;	 }	public String getIndexUrl() {		return indexUrl;	}	public void setIndexUrl(String indexUrl) {		this.indexUrl = indexUrl;	}}